import React, { useState} from 'react';
import SuggestionComp from '../../components/Suggestion/SuggestionComp';

const Suggestion = () => {
    const [isOpen, setIsOpen] = useState(false)

    const toggle = () => {
        setIsOpen(!isOpen)
    }

    return (
        <>
            
            <SuggestionComp/>
            
        </>
    );
};

export default Suggestion;
